import React, { useState, useEffect } from 'react';
import { Typography, Box, CircularProgress, Grid } from '@mui/material';
import { BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';

const API_BASE_URL = 'http://localhost:5000/api';

const TaskAnalytics = () => {
  const [taskData, setTaskData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchTaskData = async () => {
      try {
        const response = await fetch(`${API_BASE_URL}/task-analytics`);
        if (!response.ok) {
          throw new Error(`Server responded with status: ${response.status}`);
        }
        const data = await response.json();
        console.log("Fetched data:", data); // Debug log
        setTaskData(data);
        setLoading(false);
      } catch (error) {
        console.error("Fetch error:", error); // Debug log
        setError('Error fetching data: ' + error.message);
        setLoading(false);
      }
    };

    fetchTaskData();
  }, []);

  if (loading) return (
    <Box sx={{ display: 'flex', justifyContent: 'center', mt: 4 }}>
      <CircularProgress />
    </Box>
  );

  if (error) return (
    <Box sx={{ display: 'flex', justifyContent: 'center', mt: 4 }}>
      <Typography color="error">{error}</Typography>
    </Box>
  );

  if (!taskData || taskData.length === 0) {
    return (
      <Box sx={{ display: 'flex', justifyContent: 'center', mt: 4 }}>
        <Typography>No data available</Typography>
      </Box>
    );
  }

  return (
    <Box>
      <Typography variant="h5" gutterBottom>
        Task Analytics
      </Typography>

      <Grid container spacing={4}>
        {/* Difficulty Chart */}
        <Grid item xs={12} md={6}>
          <Typography variant="h6" gutterBottom>
            Average Difficulty by Assignment
          </Typography>
          <Box sx={{ height: 400 }}>
            <ResponsiveContainer width="100%" height="100%">
              <BarChart
                data={taskData}
                margin={{ top: 20, right: 30, left: 20, bottom: 40 }}
              >
                <CartesianGrid strokeDasharray="3 3" />
                <XAxis dataKey="tasknumber" />
                <YAxis label={{ value: 'Difficulty Level', angle: -90, position: 'insideLeft' }} />
                <Tooltip />
                <Legend />
                <Bar dataKey="avg_difficulty" name="Average Difficulty" fill="#8884d8" />
              </BarChart>
            </ResponsiveContainer>
          </Box>
        </Grid>

        {/* Time Chart */}
        <Grid item xs={12} md={6}>
          <Typography variant="h6" gutterBottom>
            Average Processing Time by Assignment
          </Typography>
          <Box sx={{ height: 400 }}>
            <ResponsiveContainer width="100%" height="100%">
              <BarChart
                data={taskData}
                margin={{ top: 20, right: 30, left: 20, bottom: 40 }}
              >
                <CartesianGrid strokeDasharray="3 3" />
                <XAxis dataKey="tasknumber" />
                <YAxis label={{ value: 'Time (seconds)', angle: -90, position: 'insideLeft' }} />
                <Tooltip />
                <Legend />
                <Bar dataKey="avg_processing_time" name="Average Processing Time" fill="#82ca9d" />
              </BarChart>
            </ResponsiveContainer>
          </Box>
        </Grid>
      </Grid>
    </Box>
  );
};

export default TaskAnalytics;
